exports=async function(url,bid,cid,options){const{parseContent,trimBeforeContent}=await require("transcode/parse_content");return parseContent(url,"div#content",{clientOptions:{...(options&&options.clientOptions)},preprocess:raw=>raw.replace(/<p>(?:\s|&nbsp;)*天才一秒记住本站地址：[^<]+(?:<br\s*\/>)*\s*<\/p>/,"")})};